pragma solidity >=0.5.12 <0.7.0;
pragma experimental ABIEncoderV2;

import "./SafeMath.sol";
import "./WhiteMange.sol";

contract ResourceDB is WhiteMange {
    using SafeMath for uint256;

    struct Resource {
        uint256 initDate; // date of resource upload
        address author; // owner of the resource
        bool waive; // the flag that the author gave up
        string ipfs; // the HASH value of the resource in the UDFS
        uint256 gratuityNum; // 打赏
      //  string[] lables; // 标签
      //  string[] comments; // 评论
        string[] thubanail; // 缩略图
        string cover; // 封面
        string title;
    }

    // mapping (uint => Gratuity) gratuitys;   // 所有打赏
    mapping(bytes16 => Resource) private store_;

    /* Successfully update a new resource. */
    event LogNewResource(bytes16 _resId, address indexed _author);
    event LogAddress(string info,address _resId, address indexed _author,address who);

    /* Update the content of the resource. */
    event LogUpdateResource(
        bytes16 _resId,
        address indexed _author,
        string _ipfs,
        string[] _thubanail,
        string _cover
    );


    event LogUpdateResourceWaive(
        bytes16 _resourceId,
        address indexed _author,
        bool _waive
    );

    /* Delete a resource that has already been claimed. */
    event LogDeleteResource(bytes16 _resId);

    /**W
     * @dev Constructor.
     */
    constructor() public {
     //   admin = msg.sender;
     //   owner = msg.sender;
      emit  LogAddress("construcor",admin, owner,msg.sender);
        whitelist_[msg.sender] = true;
    }

    bool private setOwner_ = false;
    function setOwner(address _center,address _admin) public {
        emit  LogAddress("ResourceDBconstrucor",_center, owner,msg.sender);
        require(!setOwner_," setOwner_: true");
        setOwner_ = true;
        owner = msg.sender;
        admin = _admin;
        whitelist_[msg.sender] = true;
        whitelist_[_center] = true;
        emit  LogAddress("getAddress",admin, owner,msg.sender);
    }

    /**
     * @dev Insert a new resource.
     * @param _sid     bytes16  : Resource index(ResourceID).
     * @param _ipfs    string   : The IPFS Hash value of the resource.
     * @param _author  address  : Declare the address of the resource.
     * @param _thubanail :
     * @param _cover :
     * @param _title :
     * @return         bool     : The successful call returns true.
     */
    function insertResource(
        bytes16  _sid,
        string memory _ipfs,
        address _author,
        string[] memory _thubanail,
        string  memory _cover,
        string  memory  _title
    ) public  returns (bool) {
        if (whitelist_[msg.sender] != true) {
            emit LogError(RScorr.Insufficient);
            return false;
        } // Check the caller's whitelist permission.

        if (isExist(_sid)) {
            emit LogError(RScorr.ObjExist);
            return false;
        } // Check if the resource exists.

        store_[_sid].author = _author;
        store_[_sid].ipfs = _ipfs;
        store_[_sid].initDate = block.timestamp;
        store_[_sid].waive = false;
        store_[_sid].thubanail = _thubanail;
        store_[_sid].cover = _cover;
        // store_[_sid].comments = new String[];
        store_[_sid].title = _title;
        emit LogNewResource(_sid, _author);

        return true;
    }

    /**
     * @dev Update the content of the resource (UDFS hash) and the pricing.
     * @param _sid       bytes16  : Resource index(CResourceID).
     * @param _author    address  : Declare the address of the resource.
     * @param _ipfs      string   : The UDFS Hash value of the resource.
     * @param _thubanail :
     * @param _cover :
     * @param _title :
     * @return           bool     : The successful call returns true.
     */
    function updateResource(
        bytes16 _sid,
        string memory _ipfs,
        address _author,
        string[] memory _thubanail,
        string memory _cover,
        string memory _title
    ) public returns (bool) {
        if (whitelist_[msg.sender] != true) {
            emit LogError(RScorr.Insufficient);
            return false;
        } // Check the caller's whitelist permission.

        if (store_[_sid].author != _author) {
            emit LogError(RScorr.IdCertifyFailed);
            return false;
        } // Verify that the resource is the caller's.

        store_[_sid].ipfs = _ipfs;
        store_[_sid].thubanail = _thubanail;
        store_[_sid].cover = _cover;
        store_[_sid].title = _title;
        emit LogUpdateResource(_sid, _author, _ipfs, _thubanail, _cover);

        return true;
    }

    /**
     * @dev The author abandons a resource.
     * @notice Canceling resource abandonment cannot be invoked by the author.
     * @param _sid     bytes16  : Resource index(ClaimID).
     * @param _author  address  : Claim the address of the resource.
     * @param _waive    bool    : True means give up, false means cancel.
     * @return          bool    : The successful call returns true.
     */
    function updateResourceWaive(bytes16 _sid, address _author, bool _waive)
        public
        returns (bool)
    {
        if (whitelist_[msg.sender] != true) {
            emit LogError(RScorr.Insufficient);
            return false;
        } // Check the caller's whitelist permission.

        if (store_[_sid].author != _author) {
            emit LogError(RScorr.IdCertifyFailed);
            return false;
        } // Verify that the resource is the caller's.

        if (store_[_sid].waive == _waive) {
            emit LogError(RScorr.Insignificance);
            return false;
        } // The updated content should not be the same.

        emit LogUpdateResourceWaive(_sid, _author, _waive);
        store_[_sid].waive = _waive;
        return true;
    }

    /**
     * @dev Admin delete resources.
     * @notice This function is limited to calls only by the admin or owner.
     * @param _sid      bytes16  : Resource index(ClaimID).
     * @return          bool     : The successful call returns true.
     */
    function deleteResource(bytes16 _sid) public returns (bool) {
        if (msg.sender != owner && msg.sender != admin) {
            emit LogError(RScorr.PermissionDenied);
            return false;
        } // Check if the caller is an administrator.

        if (store_[_sid].author == address(0)) {
            emit LogError(RScorr.ObjNotExist);
            return false;
        } // Check if the resource exists.

        delete store_[_sid];

        emit LogDeleteResource(_sid);

        return true;
    }

    /////////////////////////
    /// View
    /////////////////////////

    /**
     * @dev Find details of a specified resource
     * @notice Only allowed to be called by the address in the whitelist.
     * @param _resId   bytes16 : Resource index(ClaimID).
     */
    function getResourceInfoByID(bytes16 _resId)
        public
        view
        returns (Resource memory
        )
    {
        return store_[_resId];
    }

    /**
     * @dev Check if the resource exists
     * @param _resId bytes16  : Resource index(ClaimID).
     * @return            bool  : True means resources exist
     */
    function isExist(bytes16 _resId) public view returns (bool) {
        if (store_[_resId].author != address(0) ) {
            return true;
        }
        return false;
    }


    /**
     * @dev Get purchase information for the resource.
     * @param _resId bytes16  : Resource index(ClaimID).
     * @return    gratuityNum   :
     */
    function getGratuityNum(bytes16 _resId)
        public
        view
        returns (uint256 gratuityNum)
    {
        return store_[_resId].gratuityNum;
    }

    // function getLables(bytes16 _resId) public view returns (string[] memory lables) {
    //     return store_[_resId].lables;
    // }

    // function getComments(bytes16 _resId)
    //     public
    //     view
    //     returns (string[] comments)
    // {
    //     return store_[_resId].comments;
    // }

    function getThubanail(bytes16 _resId)
        public
        view
        returns (string[] memory _thubanail)
    {
        return store_[_resId].thubanail;
    }

    function getCover(bytes16 _resId) public view returns (string memory cover) {
        return store_[_resId].cover;
    }

    function getAuthor(bytes16 _resId) public view returns (address) {
        return store_[_resId].author;
    }

    function getTitle(bytes16 _resId) public view returns (string memory title) {
        return store_[_resId].title;
    }

    function getResourceWaive(bytes16 _resId) public view returns (bool  waive) {
        return store_[_resId].waive;
    }

     function addResourceGratuityNum(bytes16 _resId,uint value) public {
         store_[_resId].gratuityNum = SafeMath.add(store_[_resId].gratuityNum,value);
    }
}

